import React from 'react'
// import * as BooksAPI from './BooksAPI'
import '../App.css'

class Header extends React.Component {

    render() {
        return (
        <div className="list-books-title">
            <h1>MyReads</h1>
        </div>
      )
    }

}


export default Header
